import Pg3 from "./Componentes/pagina3";



function App() {

    return(
       <>
            <header>
                <Pg3/>
            </header>

            <main>
                <Routes>
                    <Route path="/pag1" component={<Pg1/>}/>
                    <Route path="/pag2" component={<Pg2/>}/>
                    <Route path="/pag3" component={<Pg3/>}/>
                </Routes>
            </main>

       </>  
    )

}
export default App;
